import React from "react";
import Avatar from '@mui/material/Avatar';
import Button from '@mui/material/Button';
import CssBaseline from '@mui/material/CssBaseline';
import TextField from '@mui/material/TextField';
import FormControlLabel from '@mui/material/FormControlLabel';
import Checkbox from '@mui/material/Checkbox';
import Link from '@mui/material/Link';
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';
import Container from '@mui/material/Container';
import { useState } from "react";
import { Redirect } from "react-router-dom/cjs/react-router-dom.min";
import { theme } from "../App";
import IconButton from '@mui/material/IconButton';
import SvgIcon from '@mui/material/SvgIcon';
import Icon from '@mui/material/Icon';
import { ThemeProvider } from "@emotion/react";
import { createSvgIcon } from '@mui/material/utils';

export const Contact = () => {
    const [statue, setStatue] = useState('');
    const [objet, setObjet] = useState('');
    const [msg, setMsg] = useState('');

    const Handleclick = () => {
        if (objet && msg) {
            setStatue('send');
        } else
            setStatue('empty')
    }

    if (statue === 'send') {
        return (
            <div className="msgsend">
                <p>Message send !</p>
                <Link to="/">
                    <button>Home</button>                    
                </Link>
            </div>
        );
    }
    if (statue === 'empty') {
        return (
            <div className="contact">
                <p>Remplir l'ensemble des données</p>
                <form onSubmit={Handleclick}>
                    <p></p>
                    <label htmlFor="email">Objet</label><p></p>
                    <input value={objet} onChange={(e) => setObjet(e.target.value)} type="text" placeholder="Objet" /><p></p>
                    <label htmlFor="text">Message</label><p></p>
                    <input value={msg} onChange={(e) => setMsg(e.target.value)}type="text" placeholder="Message"/><p></p>
                    <button type="submit">Envoyer</button>
                </form>
                <Link to="/">
                    <button>Home</button>
                </Link>
            </div>
        );
    } else {
        return (
            <ThemeProvider theme={theme}>
                <Container component="loginpage">
                    <Link to="/">
                    <IconButton aria-label="Example">
                        <FontAwesomeIcon icon={faEllipsisV} />
                    </IconButton>
                    </Link>
                    <form onSubmit={Handleclick}>
                        <p></p>
                        <label htmlFor="email">Objet</label><p></p>
                        <TextField size="small"value={objet} onChange={(e) => setObjet(e.target.value)} type="text" placeholder="Objet" /><p></p>
                        <label htmlFor="text">Message</label><p></p>
                        <TextField size="small"value={msg} onChange={(e) => setMsg(e.target.value)}type="text" placeholder="Message"/><p></p>
                        <Button type="submit">Envoyer</Button>
                    </form>
                </Container>
            </ThemeProvider>
        );
    }
}
